import "./Card.css";
import React from "react";
import bitcoin from "./bitcoin.png"

const Card = () =>{

    return(
        <div className="card-container">
            <div className="card-holder">
                <div className="card-image">
                    <img src={bitcoin}/>
                </div>
                <div className="card-details">
                    
                        <li>Name</li>
                        <li>Price</li>
                        <li>Current</li>
                    
                </div>
            </div>          
        </div>
    )
}

export default Card;
